import os
import sys
import psutil
import tkinter as tk
from tkinter import ttk, messagebox
from PIL import Image, ImageTk
import base64
import io

class AntivirusApp:
    def __init__(self, master):
        self.master = master
        master.title("RatReaper")

        # Load window icon from base64 encoded string
        icon_data = base64.b64decode(ICON_BASE64)
        window_icon = Image.open(io.BytesIO(icon_data))
        master.iconphoto(True, ImageTk.PhotoImage(window_icon))

        # Disable window resizing
        master.resizable(False, False)

        # Get screen dimensions
        screen_width = master.winfo_screenwidth()
        screen_height = master.winfo_screenheight()

        # Set window size
        window_width = screen_width // 3
        window_height = (screen_height // 4) * 3
        master.geometry(f"{window_width}x{window_height}")

        # Create style for buttons
        style = ttk.Style()
        style.configure("Red.TButton",
                        font=("Arial", 14, 'bold'),
                        foreground="black",
                        padding=10,
                        background="#FF0000",
                        relief="raised")

        # Load background image
        background_path = self.get_image_path("background.png")
        if background_path:
            background_image = Image.open(background_path)
            resized_image = background_image.resize((window_width, window_height))
            self.background_image = ImageTk.PhotoImage(resized_image)
            self.background_label = tk.Label(master, image=self.background_image)
            self.background_label.pack()

        # Create buttons
        self.scan_button = ttk.Button(master, text="Scan System", style="Red.TButton", command=self.scan)
        self.scan_button.place(relx=0.5, rely=0.4, anchor="center")

        self.remove_button = ttk.Button(master, text="Neutralize RAT", style="Red.TButton", command=self.remove)
        self.remove_button.place(relx=0.5, rely=0.52, anchor="center")
        

    def scan(self):
        # Check if indicators of compromise exist
        compromise_exist = self.check_indicators_of_compromise()

        # Check if njRAT is currently running
        njrat_running = self.check_njrat_running()

        messagebox.showinfo("Scan Results", f"System Infected:                      {compromise_exist}\n\n"
                                            f"njRAT Currently Running:      {njrat_running}")

    def remove(self):
        # End processes spawned by njRAT
        self.killProcesses()

        # Remove files added by njRAT and check if all files were successfully removed
        success = self.delete_files()

        # Check if all files were successfully removed
        messagebox.showinfo("Removal Result", "Removal process completed. Check terminal for errors.")
        

    def check_indicators_of_compromise(self):
        # List of files added by njRAT
        rootFiles = ["njq8.exe", "njRAT.exe"]

        # CHECK FOR ROOT
        for file_name in rootFiles:
            file_path = os.path.join("C:\\", file_name)
            if os.path.exists(file_path):
                return True

        # CHECK FOR STARTUP
        # Get the user's profile directory
        profile_dir = os.environ.get('USERPROFILE')
        if not profile_dir:
            print("Failed to retrieve user profile directory.")
            return

        # Directory containing the Startup file to be deleted
        startup_path = os.path.join(profile_dir, 'AppData', 'Roaming', 'Microsoft', 'Windows', 'Start Menu', 'Programs', 'Startup')

        # File name to be deleted
        file_name = "ecc7c8c51c0850c1ec247c7fd3602f20.exe"

        # Construct the full path to the file
        file_path = os.path.join(startup_path, file_name)

        # Check if the file exists and delete it if found
        if os.path.exists(file_path):
            return True

        # CHECK FOR TEMP
        # Path to the temporary file to be deleted
        temp_files = ["windows.exe", "windows.exe.tmp"]

        # Check if any of the temporary files exist
        for temp_file in temp_files:
            temp_file_path = os.path.join(profile_dir, 'AppData', 'Local', 'Temp', temp_file)
            if os.path.exists(temp_file_path):
                return True

        return False

    def check_njrat_running(self):
        # List of process names associated with njRAT
        njrat_processes = ["windows.exe", "ecc7c8c51c0850c1ec247c7fd3602f20.exe", "njRAT.exe"]

        # Get all running processes
        for process in psutil.process_iter():
            try:
                process_name = process.name()
                # Check if any njRAT process is running
                if process_name.lower() in njrat_processes:
                    return True
            except (psutil.NoSuchProcess, psutil.AccessDenied):
                pass

        return False

    def removeRoot(self):
        root_path = "C:\\"
        # List of file names to be deleted
        file_names = ["njq8.exe", "njRAT.exe"]

        for file_name in file_names:
            file_path = os.path.join(root_path, file_name)
            # Check if the file exists and delete it if found
            if os.path.exists(file_path):
                try:
                    os.remove(file_path)
                    print(f"Deleted: {file_path}")
                except OSError as e:
                    print(f"Error: {file_path} - {e}")
            else:
                print(f"File not found: {file_path}")

    def removeStartup(self):
        # Get the user's profile directory
        profile_dir = os.environ.get('USERPROFILE')
        if not profile_dir:
            print("Failed to retrieve user profile directory.")
            return

        # Directory containing the Startup file to be deleted
        startup_path = os.path.join(profile_dir, 'AppData', 'Roaming', 'Microsoft', 'Windows', 'Start Menu', 'Programs', 'Startup')

        # File name to be deleted
        file_name = "ecc7c8c51c0850c1ec247c7fd3602f20.exe"

        # Construct the full path to the file
        file_path = os.path.join(startup_path, file_name)

        # Check if the file exists and delete it if found
        if os.path.exists(file_path):
            try:
                os.remove(file_path)
                print(f"Deleted: {file_path}")
            except OSError as e:
                print(f"Error: {file_path} - {e}")
        else:
            print(f"File not found: {file_path}")

    def removeTempFile(self):
        # Get the user's profile directory
        profile_dir = os.environ.get('USERPROFILE')
        if not profile_dir:
            print("Failed to retrieve user profile directory.")
            return

        # Path to the temporary files to be deleted
        temp_files = [
            os.path.join(profile_dir, 'AppData', 'Local', 'Temp', 'windows.exe'),
            os.path.join(profile_dir, 'AppData', 'Local', 'Temp', 'windows.exe.tmp')
        ]

        for temp_file_path in temp_files:
            # Check if the file exists and delete it if found
            if os.path.exists(temp_file_path):
                try:
                    os.remove(temp_file_path)
                    print(f"Deleted: {temp_file_path}")
                except OSError as e:
                    print(f"Error: {temp_file_path} - {e}")
            else:
                print(f"File not found: {temp_file_path}")   

    def killProcesses(self):
        # List of process names to kill
        target_processes = ["windows.exe", "ecc7c8c51c0850c1ec247c7fd3602f20.exe", "njRAT.exe"]
        #target_processes = ["notepad.exe", "taskmgr.exe", "chrome.exe"]

        # Get all running processes
        for process in psutil.process_iter():
            try:
                process_name = process.name()
                # Check if the process name matches any of the target names
                if process_name.lower() in target_processes:
                    process.kill()
                    print(f"Killed process: {process_name}")
            except psutil.NoSuchProcess:
                # Ignore if the process no longer exists
                pass
            except psutil.AccessDenied:
                print(f"Access denied to kill process: {process_name}")

    def delete_files(self):
        print("\nERROR: The following files were not found. If the list is empty, please disregard this message. \nIf the files were not found, it could indicate that the removal process was successful. \nHowever, it could also mean that this version of njRAT is not currently running.\n")
        print("\n------- START OF THE LIST -------\n")
        self.removeRoot()
        self.removeStartup()
        self.removeTempFile()
        print("\n------- END OF THE LIST -------\n")

    def get_icon_path(self):
        # Check if the icon file exists in the same directory as the script
        icon_file = "icon.ico"
        if os.path.isfile(icon_file):
            return icon_file
        else:
            return None

    def get_image_path(self, image_file):
        # Check if the image file exists in the same directory as the script
        script_dir = os.path.dirname(os.path.realpath(__file__))
        image_path = os.path.join(script_dir, image_file)
        if os.path.isfile(image_path):
            return image_path
        else:
            return None

ICON_BASE64 = ""
root = tk.Tk()
app = AntivirusApp(root)
root.mainloop()